INSERT INTO `evaluations` VALUES (1,2,2015,'<ol><li>Akibat penggabungan Kementrian PUPR maka mengakibatkan nomenklatur yang berubah dan pengisian jabatan sehingga kegiatan efektif dilaksanakan pada bulan 2015</li><li>Keterlambatan penerbitan DIPA 2015 (akhir april 2015)</li><li>Pelaksanan Dekonsentrasi kurang optimal kurang lebih dilakukan selama 3 (bulan) dikarenakan waktu pelaksanaan Dekonsentrasi sangat singkat (pemblokirannya dibuka pada bulan Agustus) serta SDM yang terbatas dan belum berpengalaman</li><li>Minim nya sarana dan prasana</li><li>Pendataan terkait RTLH dan data backlog perumahan be;um optimal</li><li>Perencanaan pengembangan kawasan lingkungan hunian masih belum dapat diimplementasikan secara optimal dikarenakan keterbatasan lahan</li></ol>','<ol><li>Mempercepat turunnya DIPA tahun 2016</li><li>Melaksanakan pelelangan dini</li><li>Meningkatkan peran pemerintah Daerah melalui Dekonsentrasi</li><li>Melakukan MOU dengan BPS</li><li>Stakeholder pendataan lebih berperan aktif dalam pengalaman data</li><li>Perlu dilakukan pelatihan peningkatan kapasitas dan kualitas SDM bidang perumahan</li><li>Memfasiltasi penyusunan RP3KP melalui Dekonsentrasi dan Rencana Rinci Pengembangan Lingkungan Hunian Skala Besar dan Bukan Skala Besar</li><li>Penambahan sarana dan prasarana sesuai dengan kebutuhan</li></ol>','2016-01-09 22:13:47','2016-01-17 05:42:19');
/*!40000 ALTER TABLE `evaluations` ENABLE KEYS */;
UNLOCK TABLES;

