INSERT INTO `pages` VALUES (1,'Intro','intro','<p><span style=\"font-weight: bold; font-style: italic;\">Akuntibiltas Kinerja</span> adalah perwujudan kewajiban suatu instansi pemerintah untuk mempertanggungjawabkan keberhasilan/kegagalan pelaksanaan Program dan Kegiatan yang telah diamantkan para pemangku kepentingan dalam rangka mencapai misi organisasi.<br></p>','<p><br></p>','2016-01-03 08:03:17','2016-01-19 07:14:18'),(2,'Tupoksi','tupoksi','<h3>Direktorat Jenderal Penyediaan Perumahan</h3><p><br></p><h4><span style=\"font-style: italic;\">Tugas</span></h4><p>Direktorat Jenderal Penyediaan Perumahan mempunyai tugas menyelenggarakan perumusan dan pelaksanaan kebijakan di bidang penyediaan perumahan sesuai dengan ketentuan peraturan perundang-undangan.</p><p><br></p><h4><span style=\"font-style: italic;\">Fungsi</span></h4><p>Dalam melaksanakan tugas,Direktorat Jenderal Penyediaan Perumahan menyelenggarakan fungsi:</p><ol><li>Perumusan kebijakan di bidang penyelenggaran penyediaan perumahan;&nbsp;</li><li>Pelaksanaan kebijakan di bidang fasilitasi penyediaan rumah umum, rumah khusus, dan rumah swadaya bagi masyarakat berpenghasilan rendah;&nbsp;</li><li>Pelaksanaan kebijakan di bidang pembinaan penyelenggaraan penyediaan perumahan;&nbsp;</li><li>Penyusunan norma, standar, prosedur, dan kriteria di bidang penyelenggaraan penyediaan perumahan;&nbsp;</li><li>Pemberian bimbingan teknis dan supervisi di bidang penyelenggaraan penyediaan perumahan;&nbsp;</li><li>Pelaksanaan evaluasi dan pelaporan di bidang penyelenggaraan penyediaan perumahan;&nbsp;</li><li>Pelaksanaan administrasi Direktorat Jenderal Penyediaan Perumahan; dan&nbsp;</li><li>Pelaksanaan fungsi lain yang diberikan oleh Menteri.&nbsp;</li></ol><hr><h3>Sekretariat Direktorat Jenderal</h3><p><br></p><h4><span style=\"font-style: italic;\">Tugas</span></h4><p>Sekretariat Direktorat Jenderal mempunyai tugas melaksanakan pemberian dukungan pengelolaan administrasi kepada seluruh unit organisasi di lingkungan Direktorat Jenderal Penyediaan Perumahan.</p><p><br></p><h4><span style=\"font-style: italic;\">Fungsi</span></h4><p>Dalam melaksanakan tugas, Sekretariat Direktorat Jenderal menyelenggarakan fungsi:</p><ol><li>Pelaksanaan urusan kepegawaian, organisasi, dan tata laksana&nbsp;</li><li>Pelaksanaan urusan keuangan, pengelolaan akuntansi, serta evaluasi pelaksanaan anggaran</li><li>Koordinasi dan penyusunan peraturan perundang-undangan, fasilitasi advokasi hukum, serta penyelenggaraan komunikasi publik Direktorat Jenderal</li><li>Pelaksanaan urusan tata usaha, rumah tangga, dan penatausahaan barang milik negara Direktorat Jenderal.&nbsp;</li></ol><hr><p><span style=\"color: inherit; font-family: inherit; font-size: 24px; line-height: 1.1;\">Direktorat Perencanaan Penyediaan Perumahan</span><br></p><p><span style=\"font-weight: bold; font-style: italic;\"><br></span></p><h4><span style=\"font-style: italic;\">Tugas</span></h4><p>Direktorat Perencanaan Penyediaan Perumahan mempunyai tugas melaksanakan koordinasi dan penyusunan keterpaduan perencanaan, penyusunan rencana pengembangan lingkungan hunian, pelaksanaan kemitraan dan pembinaan kelembagaan, pengelolaan data dan informasi serta pemantauan dan evaluasi di bidang penyelenggaraan penyediaan perumahan.</p><p><br></p><h4><span style=\"font-style: italic;\">Fungsi</span><span style=\"font-weight: bold; font-style: italic;\">&nbsp;</span></h4><p>Dalam melaksanakan tugas tersebut, Direktorat Perencanaan Penyediaan Perumahan menyelenggarakan fungsi sebagai berikut:&nbsp;</p><ol><li>Koordinasi dan penyusunan keterpaduan perencanaan di bidang penyelenggaraan penyediaan perumahan;</li><li>Perencana pengembangan hunian di bidang penyelenggaraan penyediaan perumahan;</li><li>Pelaksanaan kemitraan dan pembinaan kelembagaan di bidang penyelenggaraan penyediaan perumahan;</li><li>Pengelolaan data dan informasi di bidang penyelenggaraan penyediaan perumahan;</li><li>Pelaksanaan pemantauan, evaluasi dan pelaporan di bidang penyelenggaraan penyediaan perumahan; dan</li><li>Pelaksanaan tata usaha Direktorat.</li></ol><hr><h3>Direktorat Rumah Susun</h3><p><br></p><h4><span style=\"font-style: italic;\">Tugas</span></h4><p>Direktorat Rumah Susun mempunyai tugas melaksanakan penyiapan perumusan kebijakan dan pelaksanaan kebijakan di bidang pembinaan penyelenggaraan penyediaan rumah susun, perencanaan teknik, penyusunan standar dan pedoman, pemberian bimbingan teknis dan supervisi penyediaan, penghunian dan pengelolaan serta pemantauan dan evaluasi penyediaan rumah susun.</p><p><br></p><h4><span style=\"font-style: italic;\">Fungsi</span></h4><p>Dalam melaksanakan tugas Direktorat Rumah Susun menyelenggarakan fungsi:</p><ol><li>Penyiapan perumusan kebijakan di bidang penyelenggaraan penyediaan rumah susun</li><li>Pelaksanaan kebijakan di bidang pembinaan penyelenggaraan penyediaan rumah susun</li><li>Penyusunan rencana teknik di bidang penyelenggaraan penyediaan rumah susun</li><li>Penyiapan penyusunan norma, standar, prosedur, dan kriteria di bidang penyelenggaraan penyediaan rumah susun</li><li>Pemberiaan bimbingan teknis dan supervisi di bidang penyelenggaraan penyediaan rumah susun</li><li>Pelaksanaan pemantauan dan evaluasi di bidang penyelenggaraan penyediaan rumah susun</li><li>Fasilitasi penghunian dan pengelolaan rumah susun</li><li>Pelaksanaan urusan tata usaha Direktorat.&nbsp;</li></ol><hr><h3>Direktorat Rumah Khusus</h3><p><br></p><h4><span style=\"font-style: italic;\">Tugas</span></h4><p>Direktorat Rumah Khusus mempunyai tugas melaksanakan penyiapan perumusan kebijakan dan pelaksanaan di bidang pembinaan penyelenggaraan rumah tapak khusus, perencanaan teknik, penyusunan standar dan pedoman, pengelolaan, pemantauan dan evaluasi penyediaan rumah tapak khusus, serta penyediaan rumah tapak khusus dan rumah tapak negara.</p><p><br></p><h4><span style=\"font-style: italic;\">Fungsi</span></h4><p>Dalam melaksanakan tugas, Direktorat Rumah Khusus menyelenggarakan fungsi:</p><ol><li>Penyiapan perumusan kebijakan di bidang penyelenggaraan rumah tapak khusus;</li><li>Pelaksanaan kebijakan di bidang pembinaan penyelenggaraan rumah tapak khusus</li><li>Penyiapan penyusunan rencana teknik di bidang penyelenggaraan rumah tapak khusus&nbsp;</li><li>Penyiapan penyusunan norma, standar, pedoman, dan kriteria di bidang penyelenggaraan rumah tapak khusus&nbsp;</li><li>Pemberian bimbingan teknis dan supervisi di bidang penyediaan rumah tapak khusus</li><li>Pelaksanaan pengelolaan rumah tapak khusus</li><li>Pelaksanaan pemantauan dan evaluasi rumah tapak khusus</li><li>Pelaksanaan penyediaan rumah tapak khusus dan rumah tapak Negara</li><li>Pelaksanaan tata usaha Direktorat.&nbsp;</li></ol><hr><h3>Direktorat Rumah Swadaya</h3><p><span style=\"font-weight: bold; font-style: italic;\"><br></span></p><h4><span style=\"font-style: italic;\">Tugas</span></h4><p>Direktorat Rumah Swadaya mempunyai tugas melaksanakan penyusunan rencana teknik dan penyusunan standardisasi, fasilitasi pendataan dan verifikasi, fasilitasi pemberdayaan dan kemitraan, pelaksanaan bantuan stimulan serta pemantauan dan evaluasi di bidang penyelenggaraan bantuan rumah swadaya.</p><p><br></p><h4><span style=\"font-style: italic;\">Fungsi</span></h4><p>Dalam melaksanakan tugas, Direktorat Rumah Swadaya menyelenggarakan fungsi:</p><ol><li>Penyusunan rencana teknik dan penyusunan standardisasi di bidang penyelenggaraan bantuan rumah swadaya;&nbsp;</li><li>Fasilitasi pendataan dan verifikasi data backlog rumah swadaya dan rumah tidak layak huni di bidang penyelenggaraan bantuan rumah swadaya;&nbsp;</li><li>Fasilitasi pemberdayaan masyarakat hasil pendataan dan fasilitasi akses kemitraan untuk mendapat bantuan di bidang penyelenggaraan bantuan rumah swadaya;&nbsp;</li><li>Penyiapan penerima bantuan dan pendampingan dalam pelaksanaan bantuan stimulan di bidang penyelenggaraan bantuan rumah swadaya;&nbsp;</li><li>Pemantauan dan evaluasi pelaksanaan dan pemanfaatan bantuan di bidang penyelenggaraan bantuan rumah swadaya; dan&nbsp;</li><li>Pelaksanaan tata usaha Direktorat.&nbsp;</li></ol><hr><p><span style=\"color: inherit; font-family: inherit; font-size: 24px; line-height: 1.1;\">Direktorat Rumah Umum Dan Komersial</span><br></p><p><span style=\"font-weight: bold; font-style: italic;\"><br></span></p><h4><span style=\"font-style: italic;\">Tugas</span></h4><p>Direktorat Rumah Umum dan Komersial mempunyai tugas melaksanakan perencanaan teknik dan evaluasi, penyusunan standar dan pedoman, bantuan rumah umum, fasilitasi pelaksanaan hunian berimbang dan fasilitasi penyediaan tanah bagi perumahan.</p><p><br></p><h4><span style=\"font-style: italic;\">Fungsi</span></h4><p>Dalam melaksanakan tugas,Direktorat Rumah Umum dan Komersial menyelenggarakan fungsi:</p><ol><li>Penyusunan rencana teknik, data, evaluasi, dan pelaporan di bidang penyelenggaraan penyediaan rumah umum dan komersial</li><li>Penyusunan norma, standar, pedoman, dan kriteria di bidang penyelenggaraan penyediaan rumah umum dan komersial</li><li>Pemberian bimbingan teknis dan supervisi di bidang penyelenggaraan penyediaan rumah umum dan komersial&nbsp;</li><li>Pemberian bantuan rumah umum di bidang penyelenggaraan penyediaan rumah umum&nbsp;</li><li>Fasilitasi pelaksanaan hunian berimbang di bidang penyelenggaraan penyediaan rumah umum dan komersial&nbsp;</li><li>Fasilitasi penyediaan lahan bagi perumahan</li><li>Pelaksanaan tata usaha Direktorat.&nbsp;</li></ol><div><br></div>','<p></p>','2016-01-03 08:03:17','2016-01-17 04:35:30'),(3,'Struktur Organisasi','rencana-strategis','<h4>Direktorat Jenderal Penyediaan Perumahan</h4><p><img src=\"http://silap-kinerja.com/files/struktur-organisasi/01-direkorat-jenderal-penyediaan-perumahan.jpg\" style=\"width: 842px;\"></p><hr><h4>Sekretariat Direktorat Jenderal Penyediaan Perumahan</h4><p><img src=\"http://silap-kinerja.com/files/struktur-organisasi/02-sekretariat-direktorat-jenderal-penyediaan-perumahan.jpg\" style=\"width: 842px;\"></p><hr><h4>Direktorat Perencanaan Penyediaan Perumahan</h4><p><img src=\"http://silap-kinerja.com/files/struktur-organisasi/03-direktorat-perencanaan-penyediaan-perumahan.jpg\" style=\"width: 842px;\"></p><hr><h4>Direktorat Rumah Susun</h4><p><img src=\"http://silap-kinerja.com/files/struktur-organisasi/04-direktorat-rumah-susun.jpg\" style=\"width: 842px;\"></p><hr><h4>Direktorat Rumah Khusus</h4><p><img src=\"http://silap-kinerja.com/files/struktur-organisasi/05-direktorat-rumah-khusus.jpg\" style=\"width: 842px;\"></p><hr><h4>Direktorat Rumah Swadaya</h4><p><img src=\"http://silap-kinerja.com/files/struktur-organisasi/06-direktorat-rumah-swadaya.jpg\" style=\"width: 842px;\"></p><hr><h4>Direktorat Rumah Umum dan Komersial</h4><p><img src=\"http://silap-kinerja.com/files/struktur-organisasi/07-direktorat-rumah-umum-dan-komersial.jpg\" style=\"width: 842px;\"><br></p>','<p>Struktur organisasi Kementerian Pekerjaan Umum dan Perumahan Rakyat terdiri dari satu sekretariat dan lima direktorat. Sekretariat dan direktorat tersebut antara lain:</p><ol><li>Sekretariat direktorat jenderal penyediaan perumahan</li><li>Direktorat perencanaan penyediaan perumahan</li><li>Direktorat rumah susun</li><li>Direktorat rumah khusus</li><li>Direktorat rumah swadaya</li><li>Direktorat rumah umum dan komersial</li></ol><p><a href=\"http://silap-kinerja.com/rencana-strategis\">selengkapnya...</a></p>','2016-01-03 08:03:17','2016-01-19 07:05:39'),(4,'Regulasi Laporan Kinerja','regulasi','<p><a href=\"http://silap-kinerja.com/files/perpres2014_029.pdf\">Perpres No. 29 Tahun 2014.pdf</a>&nbsp;&nbsp;tentang SISTEM AKUNTABILITAS KINERJA INSTANSI PEMERINTAHAN<br></p><p><a href=\"http://silap-kinerja.com/files/permenpan2014_053.pdf\">Permenpan No. 053 Tahun</a><a href=\"http://silap-kinerja.com/files/permenpan2014_053.pdf\">&nbsp;2014.pdf</a>&nbsp; tentang PETUNJUK TEKNIS PERJANJIAN KINERJA, PELAPORAN KINERJA DAN TATA CARA REVIU ATAS LAPORAN KINERJA</p><p><a href=\"http://silap-kinerja.com/files/PermenPUPR15-2015.pdf\">Permen PUPR No. 15/PRT/M/2015.pdf</a>&nbsp;&nbsp;tentang ORGANISASI DAN TATA KERJA KEMENTERIAN PEKERJAAN UMUM DAN PERUMAHAN RAKYAT</p>','<p><br></p>','2016-01-03 08:03:17','2016-01-07 08:56:39'),(5,'e-Doc LAKIP','lakip','<p>Dokumen LAKIP (Laporan Akuntabilitas Kinerja Instansi Pemerintahan) Kementerian PUPERA dibuat berdasarkan siklus anggaran yang berjalan selama satu tahun dan per direktorat. Berikut dokumen LAKIP dari tahun 2015 - 2019 di enam direktorat Kementerian PUPERA.</p><p><br></p><h2>Tahun 2015</h2><h3>Sekretariat Direktorat Jenderal</h3><h3>Direktorat Perencanaan Penyediaan Perumahan</h3><p><a href=\"http://silap-kinerja.com/files/1.%20Cover.pdf\" style=\"font-family: inherit; line-height: 1.1; background-color: rgb(255, 255, 255);\">Lakip 2015 Direktorat Perencanaan Penyediaan Perumahan.pdf</a></p><h3><span style=\"color: inherit; font-family: inherit; line-height: 1.1;\">Direktorat Rumah Susun</span></h3><h3>Direktorat Rumah Khusus</h3><h3>Direktorat Rumah Swadaya</h3><h3>Direktorat Rumah Umum dan Komersial</h3><h3><br></h3>','','2016-01-03 08:03:17','2016-01-30 16:37:00');
